  .overlay{position:relative;z-index:2;padding:30px;max-width:920px;width:92%;box-sizing:border-box;display:flex;gap:28px;align-items:center}
  .card{background:linear-gradient(180deg, rgba(255,255,255,0.04), rgba(255,255,255,0.02));border-radius:16px;padding:22px;display:flex;gap:20px;align-items:center;backdrop-filter:blur(6px);box-shadow:0 8px 30px rgba(0,0,0,0.6);width:100%;}
  .photo{width:320px;height:480px;flex-shrink:0;border-radius:12px;overflow:hidden;border:2px solid rgba(255,255,255,0.06);}
  .photo img{width:100%;height:100%;object-fit:cover;display:block}
  .content{flex:1;display:flex;flex-direction:column;gap:10px}
  h1{margin:0;font-size:36px;letter-spacing:0.4px}
  .names{font-weight:700;color:#ff5c8a;}
  .since{opacity:0.9}
  .counter{margin-top:8px;font-size:20px;}
  .controls{margin-top:auto;display:flex;gap:12px;align-items:center}
  .playbtn{background:#ff5c8a;border:none;padding:12px 16px;border-radius:10px;color:#fff;font-weight:700;cursor:pointer;display:inline-flex;align-items:center;gap:10px;}
  .info{font-size:14px;color:rgba(255,255,255,0.8)}
  .small{font-size:13px;color:rgba(255,255,255,0.6)}
  @media(max-width:760px){ .card{flex-direction:column;align-items:flex-start}.photo{width:100%;height:320px} h1{font-size:28px} }
</style>
<style>
.slideshow {
  position: relative;
  width: 100%;
  height: 100%;
  overflow: hidden;
}
.slideshow img {
  position: absolute;
  top: 0; left: 0;
  width: 100%; height: 100%;
  object-fit: cover;
  opacity: 0;
  transition: opacity 1s ease-in-out;
}
.slideshow img.active {
  opacity: 1;
}
</style></head>

<script>
// Counter since start date
function updateCounter(){
  const start = new Date("2023-12-04T00:00:00".replace('2023-12-04', '2023-12-04'));
  const now = new Date();
  let years = now.getFullYear() - start.getFullYear();
  let months = now.getMonth() - start.getMonth();
  let days = now.getDate() - start.getDate();
  if (days < 0) {
    months -= 1;
    const prevMonth = new Date(now.getFullYear(), now.getMonth(), 0);
    days += prevMonth.getDate();
  }
  if (months < 0) {
    years -= 1;
    months += 12;
  }
  document.getElementById('counter').textContent =
    `Eu te amo hÃ¡: ${years} ano, ${months} meses e ${days} dias`;
}
updateCounter();
setInterval(updateCounter, 1000*60); // refresh every minute

// YouTube API player creation on demand
let player;
const YT_URL = "https://www.youtube.com/iframe_api";
function loadYouTubeApi(callback){
  if (window.YT && window.YT.Player){ callback(); return; }
  const tag = document.createElement('script');
  tag.src = YT_URL;
  document.head.appendChild(tag);
  window.onYouTubeIframeAPIReady = callback;
}

document.getElementById('play').addEventListener('click', function(){
  const btn = this;
  btn.textContent = 'â³ Carregando...';
  loadYouTubeApi(function(){
    btn.disabled = true;
    if (!player){
      player = new YT.Player('player', {
        height: '0', width: '0',
        videoId: 'VWRkQARH-9o',
        playerVars: { 'autoplay': 1, 'controls': 0, 'start': 49, 'rel': 0, 'iv_load_policy': 3 },
        events: {
          'onReady': function(e){
            try{ e.target.setVolume(80); }catch(err){}
            e.target.playVideo();
            btn.textContent = 'â¯ï¸ Tocando';
            btn.disabled = false;
          },
          'onStateChange': function(e){
            if (e.data === 0) btn.textContent = 'ðŸ” Repetir';
          }
        }
      });
    } else {
      player.seekTo(49);
      player.playVideo();
      btn.textContent = 'â¯ï¸ Tocando';
      btn.disabled = false;
    }
  });
});
</script>
